import React, { useContext } from "react";
import "../App.css";
import { NavLink } from "react-router-dom";
import { Dashboard, SpeedRounded } from "@mui/icons-material/D";
import { IconButton } from "@mui/material";

const Sidebar = () => {
  return (
    <div className="max-w-24 h-full gap-12 overflow-auto bg-slate-500">
      <div className="">
        <img src="" alt="Gambars" />
        <h2>Task App</h2>
      </div>

      <div className="">
        <h3>HOME</h3>
        <ul className="list-none grid">
          <NavLink to={""} className={"flex"}>
            <IconButton>
              <Dashboard />
            </IconButton>
            <span className="text-sm">Dashboard</span>
          </NavLink>
          <NavLink to={""} className={"flex"}>
            <span className="text-sm">Tasks</span>
          </NavLink>
          <NavLink to={""} className={"flex"}>
            {/* <Dashboard/> */}
            <span className="text-sm">Unconfirmed Tasks</span>
          </NavLink>
        </ul>
      </div>
      <div className="">
        <h3>DATA</h3>
        <ul className="list-none grid">
          <NavLink to={""} className={"flex"}>
            {/* <Dashboard/> */}
            <span className="text-sm">Dashboard</span>
          </NavLink>
          <NavLink to={""} className={"flex"}>
            {/* <Dashboard/> */}
            <span className="text-sm">Tasks</span>
          </NavLink>
          <NavLink to={""} className={"flex"}>
            {/* <Dashboard/> */}
            <span className="text-sm">Unconfirmed Tasks</span>
          </NavLink>
        </ul>
      </div>
    </div>
  );
};

export default Sidebar;
